- input: "TEXT\x1CC00013748\x1CX0\x1C\x1CF3XA\x1CThis Amendment is in response to
    the Commission's Letter dated March 4, 2011.     The receipts from 'Earl Pomeroy
    for Congress' were transfers, and the report has been amended accordingly.     The
    payment on Schedule H4, in the amount of $50.28 for 'Gifts' was to FTD Flowers
    for a funeral arrangement.     Transfers-in from the 'Democratic National Committee'
    and the Democratic Congressional Campaign Committee were not designated  for,
    or used for the payments of any Exempt Activities.     As a result of the Commission's
    inquiry regarding contributions reported on Schedule A for Line 11c, the Committee
    recongnized a contribution from DRIVE PAC was incorrectly reported as recieved
    from the International Brotherhood of Teamsters. This report reflects the appropriate
    committee name and ID for the contribution. However, DRIVE PAC made a subsequent
    contribution in October of 2010. That contribution was disclosed on the Committee's
    Pre-General Report. As a result, that contribution exceeded the contribution limits
    for PACs. The Committee has transfered those funds to its Non-Federal Account,
    and will report the transfer on Schedule B for Line 29 of its 2011 April Monthly
    report.     Payments for Payroll and Payroll Taxes on Schedule H4 are for employees
    who did not spend more than 25% of their time during the period on activities
    in connection with a federal election. \n"
